import React, { useState } from "react";
import Box from "@mui/material/Box";
import LinearProgress from "@mui/material/LinearProgress";

const Progressbar = ({ currentPage, totalPages }) => {
  // Calculate percentage progress based on current page and total pages
  const progress = (currentPage / totalPages) * 100;

  // Custom styling for the LinearProgress component
  const customStyles = {
    backgroundColor: "grey",
    height: "8px",
    borderRadius: "10px",
    marginTop: "20px",
    marginBottom: "20px",
    marginLeft: "10%",
    marginRight: "10%"
  };

  return (
    <Box sx={{ width: "80%", marginLeft: "auto", marginRight: "auto" }}>
      <LinearProgress
        variant="determinate"
        value={progress}
        sx={customStyles}
      />
    </Box>
  );
};

export default Progressbar;
